import {Routes, Route, useNavigate} from 'react-router-dom';
import './App.css';
import LandingPage from './pages/landing';
import MainPage from './pages/main';


function App() {
  const navigate = useNavigate();

  const navigateToMain = () => {
    navigate('/main');
  }

  const navigateToLanding = () => {
    navigate('/');
  }

  return (
    <div>
      <Routes>
        <Route exact path="/" element={<LandingPage nav={navigateToMain}/>}/>
        <Route exact path="/main" element={<MainPage nav={navigateToLanding} />}/>
      </Routes>
    </div>
  )
}

export default App;
